import React from 'react';

function Header() {
  return (
    <section>
      <button type="button" data-testids="profile-top-btn">
        <img src="../images/profileIcon.svg" alt="profile icon" />
      </button>

      <h3 data-testids="search-top-btn">Comidas</h3>

      <button type="button" data-testids="search-top-btn">
        <img src="../images/searchIcon.svg" alt="search icon" />
      </button>
    </section>
  );
}

export default Header;
